        const {name,value} = e.target;
        setName(value);
    }

    const formHandler=(e)=>{
        e.preventDefault(); 

    }

    return (
    <>
        <form onSubmit={formHandler}>
            <input type='text' name="todo" value={name} onChange={fetchVal}/>
        </form>
    </>
    )
}

